r.x:
var $bm_rt;
var L1, L2, p1, p2, u, a;
L1 = thisComp.layer('Individual-Form-Comp-1 ');
L2 = thisComp.layer('center-point');
try {
    p1 = L1.toWorld(L1.anchorPoint);
    p2 = L2.toWorld(L2.anchorPoint);
    u = sub(p2, p1);
    a = Math.atan2(u[1], u[0]);
    $bm_rt = radiansToDegrees(a);
} catch (e) {
    $bm_rt = value;
}

p.x:
var $bm_rt;
var L1, p1;
L1 = thisComp.layer('Individual-Form-Comp-1 ');
$bm_rt = p1 = L1.toWorld(L1.anchorPoint);

a.x:
var $bm_rt;
var s;
s = content('Joint').content('Joint Path').size;
$bm_rt = [
    -s[0] / 2,
    0,
    0
];

s.x:
var $bm_rt;
var strokeW, L1, L2, p1, p2, dist;
strokeW = 1;
L1 = thisComp.layer('Individual-Form-Comp-1 ');
L2 = thisComp.layer('center-point');
p1 = L1.toWorld(L1.anchorPoint);
p2 = L2.toWorld(L2.anchorPoint);
dist = length(sub(p2, p1));
$bm_rt = [
    dist,
    strokeW
];

var $bm_rt;
var L, l;
L = content('Joint').content('Joint Path').size[0];
l = content('Joint').content('Joint Path').size[1];
$bm_rt = sum(0.000001, mul(100, div(l, mul(2, sum(L, l)))));

